13451.source:
function run() {
    if(this.ProfilingLayer){
        this.ProfilingLayer.unwrapAll();
    }

    if(!Global.ProfilingWrapper){
        module('projects.BP2012.Profiling').load(true);
    }
    this.ProfilingLayer = new ProfilingWrapper();

    if( !this.benchmarkedMethod) {
        return;
    }

    this.maxRepetitions = this.maxRepetitions || 5;
    alertOK(this.benchmarkedMethod + " " + this.maxRepetitions + " times");

    var morph = this.get("Container").submorphs[0];
    if (!morph) {
        alert("there is no morph to profile");
        return;
    }

    parameters = this.calculateParameters();

    var self = this;

    if(this.profileClasses){
        Global.classes(true).forEach(function(klass){
            self.ProfilingLayer.wrapObject(klass.prototype);
        })
    }
    morph = this.prepareMorph(morph, true);

    var delta = 0;

    var func = morph[self.benchmarkedMethod];
    if(typeof func !== "function"){
        return;
    }

    var before = new Date().valueOf();

    this.ProfilingLayer.isActive = true;
    {
        for(var i = 0; i < self.maxRepetitions; i++){
            func.apply(morph, parameters);
        }
    }
    this.ProfilingLayer.isActive = false;  

    delta = new Date().valueOf() - before;
    delta /= self.maxRepetitions;  

    morph.remove();
    this.get("output").textString = "" + delta + "ms";
    this.retrieveResults();
    this.showTimePerScript();
    this.ProfilingLayer.unwrapAll();
}

13455.source:
function updateParameterList() {
    var morph = this.get("Container").submorphs[0];
    if (!morph) {
        return;
    }

    var func = morph[this.benchmarkedMethod];
    if(typeof func !== "function"){
        return;
    }
    var reg = /\(([\s\S]*?)\)/;
    var params = reg.exec(func);
    var param_names = [];
    if (params){
        param_names = params[1].split(',');
    }

    this.get("ParameterList").updateList(param_names);
    this.get("ParameterList").selectAt(0);
}

13459.source:
function updateMethodList() {
    var morph = this.get("Container").submorphs[0];
    if (!morph) {
        return;
    }

    this.params = {};

    this.get("MethodList").updateList(this.sortedScriptNamesOfObj(morph));
    this.get("MethodList").selectAt(0);
}

13463.source:
function sortedScriptNamesOfObj(obj) {

    if (!Functions.own(obj) ||  Functions.own(obj).size() == 0) return [];

    var selectedScripts = Functions.own(obj).
	select(function(name) { return obj[name].getOriginal().hasLivelyClosure }).
	sortBy(function(name) { return name.toLowerCase() });

    return selectedScripts;
}

13467.source:
function calculateParameters() {
    var methodName = this.get("MethodList").selection;

    if(!this.params){
        this.params = {};
    }

    if(!this.params[methodName]){
        this.params[methodName] = {};
    }

    var out = [];

    var paramNames = this.get("ParameterList").itemList;

    for(var i = 0; i < paramNames.length; i++){
        out[i] = eval(this.params[methodName][paramNames[i]]);
    }

    return out;

}

13471.source:
function showParameterDefinition() {
    var methodName = this.get("MethodList").selection;
    var paramName = this.get("ParameterList").selection;
    if(!paramName){
        this.get("ParamDef").textString = "";
        return;
    }

    if(!this.params){
        this.params = {};
    }

    if(!this.params[methodName]){
        this.params[methodName] = {};
    }

    if(!this.params[methodName][paramName]){
        this.params[methodName][paramName] = "undefined";
    }

    this.get("ParamDef").textString = this.params[methodName][paramName];
}

13475.source:
function setParameterDefinition() {
    var methodName = this.get("MethodList").selection;
    var paramName = this.get("ParameterList").selection;

    if(!this.params){
        this.params = {};
    }

    if(!this.params[methodName]){
        this.params[methodName] = {};
    }

    this.params[methodName][paramName] = this.get("ParamDef").textString || "undefined";
}

13479.source:
function showTimePerScript() {
    if(!this.ProfilingLayer){
        return;
    }
        var self = this;

        this.sortName = this.sortName || "total";
        var dir = this.lowFirst ? 1 : -1;
        this.measured.sort(function(left, right) {
            var a = left[self.sortName],
                b = right[self.sortName];
            return a > b ? dir : a < b ? -dir : 0;
        });

        var table = this.get("TimePerScript")

    	table.submorphs.forEach(function(ea){
            ea.remove();
        });

        var headers = ["object", "script", "total", "self"];

        for(var i = 0; i < headers.length; i++){
            table.addMorph(this.createHeaderText(i, headers[i]));
        }

        for(var i = 0; i < this.measured.length; i++){
            table.addMorph(this.createDataText(0, i,
                this.measured[i].object));
            table.addMorph(this.createDataText(1, i,
                this.measured[i].script));
            table.addMorph(this.createDataText(2, i, 
                this.divideAndRound(this.measured[i].total) + "ms"));
            table.addMorph(this.createDataText(3, i, 
                this.divideAndRound(this.measured[i].self) + "ms"));
        }
}

13483.source:
function prepareMorph(morph, doCopy) {
    if(!this.ProfilingLayer){
        return;
    }
    var name = morph.getName();

    if(doCopy){
        morph = morph.copy();
        $world.addMorph(morph);
    }
    morph.setName(name);

    var self = this;
    morph.withAllSubmorphsDo(function(ea){
        self.ProfilingLayer.wrapObject(ea);
    });

    return morph;
}

13491.source:
function createHeaderText(x, text) {
    var textMorph = new lively.morphic.Text();
    textMorph.textString = text;
    var color;
    if(this.sortName == text){
        color = Color.gray;
        textMorph.textString += this.lowFirst ? "\u2193" : "\u2191";
    }else{
        color = Color.gray.lighter();
    }
    textMorph.applyStyle({
        fill: color,
        fixedWidth: true,
        fixedHeight: false,
        borderWidth: 1,
        allowInput: false
    });

    textMorph.setExtent(pt(100,40));
    textMorph.setPosition(textMorph.getExtent().scaleByPt(pt(x, 0)));
    var self = this;
    textMorph.onClick = function(){
        textMorph.setFill(Color.gray.darker());
        self.sortResultsBy.bind(self,text).delay(0);
    };
    textMorph.registerForEvents();
    return textMorph;
}

13495.source:
function createDataText(x, y, text) {
    var textMorph = new lively.morphic.Text();
    textMorph.textString = text;
    textMorph.applyStyle({
        fill: Color.white,
        fixedWidth: true,
        fixedHeight: false,
        borderWidth: 1
    });

    textMorph.setExtent(pt(100,40));
    textMorph.setPosition(textMorph.getExtent().scaleByPt(pt(x,y+1)));

    return textMorph;
}

