function reset() {
    if(this.ProfilingLayer){
        this.ProfilingLayer.unwrapAll();
    }
    var table = this.get("TimePerScript")

    table.submorphs.forEach(function(ea){
        ea.remove();
    });
}

13511.source:
function sortResultsBy(sortName) {
    var legalSortNames = ['object', 'script', 'total', 'self'];
    if(legalSortNames.include(sortName)){
        if(this.sortName == sortName){
            this.lowFirst = !this.lowFirst;
        }
        this.sortName = sortName;
        this.showTimePerScript();
    }
}

13515.source:
function retrieveResults() {
    this.measured = [];

    var self = this;
    this.ProfilingLayer.wrappedObjects.forEach(function(obj){
        var objResults = self.ProfilingLayer.getTimesForObject(obj);
        objResults.methodNames.select(function(ea){
            return objResults.time[ea] > 0;
        }).forEach(function(ea){
            self.measured.push({
                object: obj.name || (obj.constructor ? obj.constructor.type : obj.toString()),
                script: ea,
                total: objResults.time[ea],
                self: objResults.timeSelf[ea]
            })
        })
    });
}

